// Button.jsx
import React from 'react';

const Button = ({ title, onClick }) => {
  return (
    <button
      className="inline-flex items-center justify-center px-6 py-3 m-2 text-lg font-medium text-white bg-gray-600 border-2 border-black rounded hover:bg-blue-400 hover:border-blue-400 transform hover:scale-105 transition-all duration-300 ease-in-out"
      onClick={onClick}
    >
      {title}
    </button>
  );
};

export default Button;
